import './App.css'
import Header from './components/Header'

function App() {
  return (
    <div className="App">
      <Header />
      <div className="container">
        <button className="open-filters-button">Filtrar<img src="./logo.svg" alt="Logo" width="200" /></button>
      </div>
    </div>
  )
}

export default App
